import React from 'react'
import Data from './colleges.json'
import Image from "./images/college_02.jpg"
const Card=()=> {
    return (
      <div className="App">
       
          { Data.colleges.map((post) => {
            return (
              <>
             
               <div className="card-container">
                   <div className="image-container">
                       <img src={Image} alt=""/>
                       <div style={{display:"flex"}}>
                       <div style={{marginRight:"50px",fontWeight:"bold",color:"gray"}}>{post.college_name}</div> 
                       <span style={{marginLeft:"180px",fontSize:"11px",color:"gray" }}><s>{post.original_fees}</s>  
                        <span style={{ marginLeft:"10px",backgroundColor:"red",color:"white"}}>{post.discount}</span></span>
                       </div>
                        <p style={{marginRight:"30px",fontSize:"12px"}}>{post.nearest_place} | <span style={{color:"gray"}}>{post.dis}</span>
                         <span style={{marginLeft:"90px",fontSize:"30px", color:"red"}}>{post.discounted_fees}</span>
                         <p>{post.fees_cycle}</p>
                         </p>
                         

                   </div>
                  
               </div>
              </>
            )
          })}
        </div>
    
    );
  }
  
export default Card
